import './App.css';
import Home from "./Routes/Home";

import {
    BrowserRouter as Router,
    Routes,
    Route,
    Link
} from "react-router-dom";

const App = () => {



    return (
        <Router>
            <Routes>
                <Route path={"/"}>
                    <Home/>
                </Route>
            </Routes>
        </Router>
    );
}

export default App;
